descricao:
Ozil, a mochila que veio para ajudar as pessoas a abraçar as aventuras da vida, transportar seus pertences e equipamentos de uma forma original e descontraída, além da satisfação em usar uma peça construída com qualidade, inovação e modernidade.

Características do produto:
Mochila executiva, 100% poliéster de alta resistência;
Resistente a pequenas quantidades de chuva como garoas e respingos;
Alça reforçada com cabo de aço e apoio para mão emborrachado;
Logo, puxadores e detalhes em metal;
Etiquetas, logo e forro personalizados;
4 compartimentos;
1 Bolso principal com compartimento acolchoado para notebook de até 15,6’’
1 Bolso frontal para guardar pequenos objetos como: canetas, lápis e documentos
Bolsos laterais telados podendo armazenar garrafa de água.
Alças ergonômicas e reguláveis;
Almofadado na parte traseira das costas;
Mochila autêntica, resistente e original;

Especificações técnicas:
SKU: OZ0030Z
Modelo: Executiva
Material: 100% poliéster
Marca: Ozil
Medição (AxLxP): 45x30x15cm
Peso: 850g
